import React, { useState } from "react";

function Check({ id, category, text }) {
  const handleChange = (event) => {};

  return (
    <div>
      <span>{text}</span>
      <input
        type="checkbox"
        id={id}
        name={`Check${id}`}
        onChange={() => {
          handleChange();
        }}
      />
    </div>
  );
}

export default Check;
